import {
  Button, Card, Container, Row, Col,
} from 'react-bootstrap';

function HomePage() {
  return (
    <div>

      <Container fluid="md">
        <Row>
          <Col xs={5}>
            <Row>
              <h1 className="display-1 p-5 ml-2 mr-2 mt-5">Hi there!</h1>
            </Row>
            <Row>
              <p className="lead  ml-2">My name</p>
            </Row>
          </Col>
          <Col />
        </Row>

        <Card className="p-5 ml-2 mr-2 mt-5">
          <ol><Button variant="outline-primary" href="/">Home</Button></ol>
          <ol><Button variant="outline-primary" href="/pf">Portfolio</Button></ol>
          <ol><Button variant="outline-primary" href="/about-me">About Me</Button></ol>
        </Card>
      </Container>
    </div>

  );
}

export default HomePage;
